// SPDX-License-Identifier: Unlicense

pragma solidity ^0.8.21;

// Import the CREATE3 library
import "./CREATE3.sol";

// Import the KeyPosterFactory contract. Adjust the path as needed.
import "./KeyPosterFactory.sol";

contract KeyPosterFactoryCreator {
    // Event to log the creation of a contract
    event ContractCreated(address contractAddress);

    // Function to create a KeyPosterFactory using a salt and an initial owner
    function createKeyPosterFactory(bytes32 salt) public {
        // Prepare the creation code for KeyPosterFactory
        bytes memory creationCode = type(KeyPosterFactory).creationCode;

        // Use the CREATE3 library to deploy the contract
        address contractAddress = CREATE3.deploy(salt, creationCode, 0);

        // Emit an event to log the address of the created contract
        emit ContractCreated(contractAddress);
    }
}

